import React, {useRef} from 'react';
import {IonRow, IonButton} from '@ionic/react';
import ReactCodeInput from 'react-verification-code-input';

const TestCodeControl: React.FC<{inputCode: string}> = props => {

    return (
        <IonRow>
            <ReactCodeInput>{props.inputCode}</ReactCodeInput>
            <h2>{props.inputCode}</h2>
        </IonRow>
    );
};

export default TestCodeControl;
